 import React from 'react'
 
 const Navbar = () => {
  
  const links = [
    {
        id:1,
        link:'home'
    },
    {
        id:2,
        link:'movies/shows'
    },
    {
        id:3,
        link:'subscription'
    },
    {
        id:4,
        link:'profile'
    },
  ]  
  return (
    <>
    <nav className='bg-cyan-500'>
        <ul>
        {
            links.map(({id, link})=>{
return(<>
{link}
</>)
            })
        }
        </ul>
    </nav>
    </>
   );

 }
 
 export default Navbar
